export const styled = (theme) => ({
    gridBooking: {
        margin : theme.spacing(2),
    },
    choiceChair: {
        backgroundColor: "#6645fd",
        "&:hover": {
            backgroundColor: "#6645fd",
        },
    },
    pading: {
        padding: theme.spacing(2),
    },
})
